import React from 'react';
import './marqueue.css';

const Marqueue = () => {
  return (
    <div className="marqueue-container">
      <div className="marqueue-content">
        <h2>Crackers available in 365 days,we deliver to Tamilnadu,Kerala,Andra and other states.The Minimum order values are 3000 for Tamilnadu and 5000 for all other states.Thank you!</h2>
      </div>
    </div>
  );
};

export default Marqueue;
